import {Link} from 'react-router-dom'


const Dummy=[
{idd:'e1', title:'E1PAGE'},
{id:'e2', title:'E2PAGE'}
]


function EventPage(){
    return <>
      <h1>EventPage </h1>
<ul>
    {Dummy.map((abc)=>{
        return         <li>
            <Link to={abc.idd} >{abc.title}</Link>
        </li>
    })}
</ul></>
   
}
export default EventPage
